import React, { useEffect, useState } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";
import { Card, Button, Container, Row } from "react-bootstrap";

const RecipeList = () => {
	const [recipes, setRecipes] = useState([]);
	const { query } = useParams();
	const [page, setPage] = useState(0);
	const [currentIndex, setCurrentIndex] = useState(0);
	const appId = process.env.REACT_APP_EDAMAM_APP_ID;
	const appKey = process.env.REACT_APP_EDAMAM_APP_KEY;

	const fetchRecipes = () => {
		axios
			.get(
				`https://api.edamam.com/search?q=${query}&app_id=${appId}&app_key=${appKey}&from=${page}&to=${
					page + 10
				}`
			)
			.then((response) => {
				setRecipes((prevRecipes) => [...prevRecipes, ...response.data.hits]);
				setPage((prevPage) => prevPage + 10);
			})
			.catch((error) => console.error("Error:", error));
	};

	useEffect(() => {
		fetchRecipes();
	}, []);

	const handleNext = () => {
		if (currentIndex === recipes.length - 1) {
			fetchRecipes();
		}
		setCurrentIndex(currentIndex + 1);
	};

	const handlePrev = () => {
		if (currentIndex > 0) {
			setCurrentIndex(currentIndex - 1);
		}
	};

	const recipe = recipes[currentIndex];

	if (!recipe) return <p>Loading...</p>;

	return (
		<Container className='d-flex justify-content-center align-items-center'>
			<Button
				onClick={handlePrev}
				disabled={currentIndex === 0}>
				Previous
			</Button>
			<Card
				className='mx-2 shadow p-3 mb-5 bg-white rounded mx-5 my-5'
				style={{ backgroundColor: "#f8f9fa", width: "40rem" }}>
				<Card.Img
					variant='top'
					src={recipe.recipe.image}
					style={{ maxHeight: "250px", objectFit: "scale-down" }}
				/>
				<Card.Body className='d-flex flex-column justify-content-between'>
					<Card.Title className='border-bottom text-primary'>
						{recipe.recipe.label}
					</Card.Title>
					<Card.Text>
						<ul className=''>
							{recipe.recipe.ingredientLines.map((ingredient, i) => (
								<li key={i}>{ingredient}</li>
							))}
						</ul>
						<div className='text-center'>
							<Row>
								<div className='col'>
									<strong>Energy:</strong>{" "}
									{parseFloat(
										(recipe.recipe.totalNutrients?.ENERC_KCAL?.quantity /
											recipe.recipe.yield) *
											4
									).toFixed(2)}{" "}
									{recipe.recipe.totalNutrients?.ENERC_KCAL?.unit}
								</div>
								<div className='col'>
									<strong>Fat:</strong>{" "}
									{parseFloat(
										(recipe.recipe.totalNutrients?.FAT?.quantity /
											recipe.recipe.yield) *
											4
									).toFixed(2)}{" "}
									{recipe.recipe.totalNutrients?.FAT?.unit}
								</div>
							</Row>
							<Row>
								<div className='col'>
									<strong>Carbs:</strong>{" "}
									{parseFloat(
										(recipe.recipe.totalNutrients?.CHOCDF?.quantity /
											recipe.recipe.yield) *
											4
									).toFixed(2)}{" "}
									{recipe.recipe.totalNutrients?.CHOCDF?.unit}
								</div>
								<div className='col'>
									<strong>Protein:</strong>{" "}
									{parseFloat(
										(recipe.recipe.totalNutrients?.PROCNT?.quantity /
											recipe.recipe.yield) *
											4
									).toFixed(2)}{" "}
									{recipe.recipe.totalNutrients?.PROCNT?.unit}
								</div>
							</Row>
						</div>
					</Card.Text>
				</Card.Body>
			</Card>
			<Button
				onClick={handleNext}
				disabled={currentIndex === recipes.length - 1}>
				Next
			</Button>
		</Container>
	);
};

export default RecipeList;
